import React from 'react';
import "./Todos.css"


const todos=props=>{
    return(
        <React.Fragment >
            <div className="row">
            <div className="col-4 offset-1">{props.task}</div>
            <div className="col-4">{props.deadline}</div>
            <button className="col-2 btn btn-outline-success">delete</button>
            </div> 
        </React.Fragment>
    )
}

export default todos;
